import Link from 'next/link'

const Navigation=()=>{
    return(
        <ul>
            <li>
                <Link>
                    <a>Services</a>
                </Link>
            </li>
            <li>About</li>
            <li>Services</li>
        </ul>

    ) 
}
export default Navigation;
